import {LinksPage} from "./page/LinksPage";
import React from 'react'
import {  Swith ,Route, Redirect } from "react-router-dom"
import {CreatePage} from "./page/CreatePage";
import {AuthPage} from "./page/AuthPage";
import{DetailPage} from "./page/DetailPage";


export const useRoutes = isAuthenticacated => {
    if (isAuthenticacated) {
        return (
            <Swith>
            <Route path="/links" exact>
                <LinksPage/>
            </Route>
            <Route path="/create" exact>
                <CreatePage/>
            </Route  >

            <Route path ="/detail/:id">
            <DetailPage/>
            </Route>
                <Redirect to="/create"/>
            </Swith>
        ) }
    return (
        <Swith>
            <Route path="/" exact>
                <AuthPage/>
            </Route>
            <Redirect to="/"/>

        </Swith>
    )
}
